import React from 'react';


class MoviesList extends React.Component{
    constructor(props){
      super(props)

    this.state = {
      MoviesList: []
    }
  }
    componentDidMount() {
      console.log("Hello")
        fetch('https://api.themoviedb.org/3/discover/movie?')
        .then(res => res.json())
        .then((data) => {
          this.setState({ MoviesList: data })
        })
        .catch(console.log)
      }

    render(){
        return(
            console.log("Hello")
        )
    }
}

export default MoviesList;
